import React from "react";
import CourseCardComponent from "./CourseCardComponent";
import courseService from "../services/CourseService";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./course-list.style.client.css";
import "./styles.css";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faFileAlt, fas, faBars, faPlusCircle, faList} from "@fortawesome/free-solid-svg-icons";
import {library} from '@fortawesome/fontawesome-svg-core';
//import {Link} from "react-router-dom";
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import {classes} from "istanbul-lib-coverage";



library.add (
    faFileAlt,
    fas,
    faBars,
    faPlusCircle,
    faList
)
const CourseGridComponent = ({ courses, deleteCourse, updateCourse }) =>
    <div>
      <div className="form-group row header-bar d-none d-lg-flex">
        <div className="col-sm-8">
          <button className="btn btn-headerbar wbdv-header wbdv-title" type="button" id="title-filter">
            Recent Documents
          </button>
        </div>
        <div className="col-sm-2">
          <div className="dropdown">
            <button className="btn btn-ownedby btn-headerbar wbdv-header wbdv-owner" type="button">
              Owned by Me
            </button>
          </div>
        </div>
        <div className="col-sm-2">
          <button className="btn btn-headerbar wbdv-header wbdv-sort" type="button">
            Sort
          </button>
        </div>
      </div>
      <div className="card-columns row">
        {
          courses.map(function (course, index) {
            return (
                <CourseCardComponent
                    index={index}
                    course={course}
                    deleteCourse={deleteCourse}
                    updateCourse={updateCourse} />
            )
          })
        }
      </div>
    </div>

export default CourseGridComponent
